angular.module('garminEditorApp').run(['$templateCache', function($templateCache) {
    $templateCache.put('editor/editor.html',
        "\n<div class=\"col-sm-12\">\n  <h2>Summary of ride</h2>\n  <div class=\"row\">\n    <div class=\"col-sm-12\">\n      <div class=\"row\">\n        <div class=\"col-sm-4\">\n          <p>startTime: {{vm.startTime | date: \"d MMM yy, HH:mm:ss\"}}</p>\n        </div>\n        <div class=\"col-sm-4\">\n          <p>endTime: {{vm.endTime | date: \"d MMM yy, HH:mm:ss\"}}</p>\n        </div>\n      </div>\n      <div class=\"row\">\n        <div class=\"col-sm-2\"><strong>Lap</strong></div>\n        <div class=\"col-sm-2\"><strong>lapStart</strong></div>\n        <div class=\"col-sm-2\"><strong>lapEnd</strong></div>\n        <div class=\"col-sm-2\"><strong>Lap time</strong></div>\n        <div class=\"col-sm-2\"><strong>Distance</strong></div>\n        <div class=\"col-sm-2\"><strong>Avg speed</strong></div>\n      </div>\n      <div ng-repeat=\"lap in vm.data.Lap\" class=\"row\">\n        <div class=\"col-sm-2\"><strong>{{$index + 1}}</strong></div>\n        <div class=\"col-sm-2\">\n          <p>{{lap.Track[0].Trackpoint[0].Time[0] | date: \"HH:mm:ss\"}}</p>\n        </div>\n        <div class=\"col-sm-2\">\n          <p>{{lap.Track[0].Trackpoint[lap.Track[0].Trackpoint.length - 1].Time[0] | date: \"HH:mm:ss\"}}</p>\n        </div>\n        <div class=\"col-sm-2\">\n          <p>{{lap.TotalTimeSeconds[0]}}s</p>\n        </div>\n        <div class=\"col-sm-2\">\n          <p>{{lap.DistanceMeters / 1000 | number : 3}} km</p>\n        </div>\n        <div class=\"col-sm-2\">\n          <p>{{lap.Extensions[0].LX[0].AvgSpeed[0] * 60 * 60 / 1000 | number : 1}} km/h</p>\n        </div>\n      </div>\n      <div class=\"row\">\n        <div class=\"col-md-2\"></div>\n        <div class=\"col-sm-2\"></div>\n        <div class=\"col-sm-2\"></div>\n        <div class=\"col-sm-2\"></div>\n        <div class=\"col-sm-2\"><strong>{{vm.totalDist / 1000 | number: 1}} km</strong></div>\n        <div class=\"col-sm-2\"></div>\n      </div>\n    </div>\n  </div>\n  <h2>Table of data</h2>\n  <div class=\"row\">\n    <section id=\"tableData\" class=\"col-sm-6\">\n      <p>Choose the rows of data to delete below.</p>\n      <div scroll-to=\"scroll-to\" data-target=\"{{vm.scrollPos}}\" class=\"dataTable\">\n        <table ng-repeat=\"lap in vm.data.Lap track by $index\">\n          <tr>\n            <th class=\"check\"></th>\n            <th>Timestamp</th>\n            <th>Speed (km/h)</th>\n            <th>Accum Dist. (m)</th>\n          </tr>\n          <tr ng-repeat=\"tp in lap.Track[0].Trackpoint\">\n            <td>\n              <input type=\"checkbox\" ng-model=\"vm.checkboxes[$parent.$index].row[$index]\" ng-change=\"vm.checkChange($parent.$index, $index)\"/>\n            </td>\n            <td>{{tp.Time[0] | date: 'H:mm:ss'}}</td>\n            <td></td>\n            <td>{{tp.DistanceMeters[0] | number : 1}} m</td>\n          </tr>\n        </table>\n      </div>\n      <div>\n        <p>Use Shift+Click to select multiple rows</p>\n        <button ng-click=\"vm.deletePoints()\" class=\"btn btn-danger\">{{vm.deleteMsg}}</button>\n        <button ng-click=\"vm.saveFile()\" class=\"btn btn-success btn-disabled\">Download .tcx</button><a ui-sref=\"main.upload\" class=\"btn btn-primary\">Load different file</a>\n      </div>\n    </section>\n    <div class=\"col-sm-6\"><map height=\"300px\" center=\"43.659, 5.26\" zoom=\"12\" draggable=\"true\" map-type-control=\"false\" auto-refresh=\"auto-refresh\"></map>\n      <p>Gaps between changes of colour (laps) are to be expected and do not affect final results</p>\n    </div>\n  </div>\n  <div class=\"row feedback\">\n    <div class=\"col-md-12\">\n      <feedback endpoint=\"/api/feedback\"></feedback>\n    </div>\n  </div>\n</div>");
}]);
angular.module('garminEditorApp').run(['$templateCache', function($templateCache) {
    $templateCache.put('upload/upload.html',
        "\n<div class=\"col-sm-12\">\n  <div class=\"row\">\n    <div class=\"col-sm-6\">\n      <p>Ever left your Garmin running at the end of a ride? All your hard earned averages declined pointelessly? </p>\n      <p>This simple editor enables you to delete points from the [b end] of a file, and will then recalculate the overall ride data and return a new copy of the file.</p>\n      <p>To start upload a '.tcx' file. You can convert a .fit file to .tcx using <a href=\"http://connect.garmin.com/\"> Garmin Connect's</a> export functionality.</p>\n      <p><strong>Warning:</strong> This app has only been tested on an Edge 800 (cycle GPS) with firmware 2.6. YMMV, but a Garmin 610 user reported success. </p>No copy of the data uploaded or processed is kept.\n      <div ng-file-select=\"ng-file-select\" ng-model=\"myFiles\" ng-file-change=\"fileSelected($files, $event)\" accept=\"*.tcx\" class=\"btn btn-primary btn-upload\">{{vm.msg}}</div>\n    </div>\n    <div class=\"col-sm-6\"><img src=\"edge.jpg\" alt=\"edge 800\"/></div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12\">\n      <h3>Change log</h3>\n      <p>24 Jan: &lt;shift&gt;+click functionality improved; fixed bug when deleting entire lap</p>\n      <p>31 Jan: fixed bug when deleting last lap</p>\n      <p>2 Feb: Use colours to distinguish laps, highlight rows where speed = 0</p>\n      <p>29 June: Handles delete from start correctly; fixed potential crashes</p>\n    </div>\n  </div>\n  <div class=\"row\">\n    <div class=\"col-xs-12\">\n      <h3>Todo</h3>\n      <p>Time is incorrectly shown on screen</p>\n      <p>Provide option to change ride time (and avg speed) to time spent moving (i.e. dropping lunch stops where GPS left on)</p>\n      <p>Show total distance for info</p>\n      <p>reset global start time after delete from begin</p>\n    </div>\n  </div>\n</div>");
}]);
